eval("module.exports = [{\"id\":\"0\",\"name\":\"Максім Багдановіч\",\"birthplace\":\"Мінск\",\"photo\":\"./data/img/Bogdanovich1.jpg\",\"biography\":[{\"date\":\"9 снежня 1891\",\"description\":\"Максім Багдановіч нарадзіўся ў Мінску. Прадзед паэта па матчынай лініі быў праваслаўным сьвятаром, дзед - дробным чыноўнікам. Бацька Максіма Адам Ягоравіч служыў настаўнікам. Ён перажыў сына, пасля напісаўшы яго біяграфію. У Максіма было два браты - Вадзім і Леў.\"},{\"date\":\"1892\",\"description\":\"Калі дзіцяці споўнілася ўсяго некалькі месяцаў, яго бацькі перавялі ў Гродна. Тут хлопчык упершыню прылучыўся да кніг. Адам Ягоравіч быў вялікім кнігалюб, збіральнікам беларускага фальклору. У доме мелася багатая бібліятэка. Першымі кнігамі маленькага Максіма сталі «Буквар», «Дзіцячы свет» К. Ушынскага і напісанае па-беларуску «Роднае слова».\"},{\"date\":\"16 кастрычніка 1896\",\"description\":\"Праз месяц пасля родаў дачкі ў Марыі Багдановіч была выяўленая сухоты (сухоты лёгкіх). Лячэнне («вёска, кефір, кваякол, кадэін») не дапамагло і маці будучага паэта памерла. Пахавана яна была на Гродзенскім праваслаўных могілках перад царквой, направа ад галоўных варот і дарогі ў царкву.\"},{\"date\":\"лістапад 1896\",\"description\":\"Адам Багдановіч з дзецьмі пераехаў па службе ў Ніжні Ноўгарад. Тут у яго завязаліся сяброўскія адносіны з Максімам Горкім, з якім яны неўзабаве парадніліся, ажаніўшыся на сёстрах Е. П. і А. П. Волжиных. Горкі часта бываў у іх дома, ён аказаў ўплыў на каханне хлопчыка да літаратуры.\"},{\"date\":\"1902\",\"description\":\"Максім паступіў у Ніжагародскую мужчынскую гімназію.\"},{\"date\":\"1907\",\"description\":\"Гэты год лічыцца пачаткам літаратурнай дзейнасці Максіма Багдановіча. Яго першым значным мастацкім творам быў апавяданне «Музы́ка» на беларускай мове, які адразу ж надрукавала «Наша ніва».\"},{\"date\":\"чэрвень 1908\",\"description\":\"Багдановічы зноў пераязджаюць па прычыне змены месца службы бацькі - гэтым разам у Яраслаўль. Там Максім Багдановіч піша першыя лірычныя вершы: «Над магілай, «Прыйдзе вясна», «На чужыне», якія былі апублікаваныя ў «Нашай ніве».\"},{\"date\":\"1909\",\"description\":\"Максім Багдановіч захварэў на сухоты.\"},{\"date\":\"1911\",\"description\":\"Скончыўшы гімназію ён адпраўляецца ў Вільню, знаёміцца ​​з Вацлавам Ластоўскім, Антонам і Іванам Луцкевічамі і іншымі дзеячамі беларускага Адраджэння. Будучы ў Вільні, малады паэт азнаёміўся ў прыватным музеі братоў Луцкевічаў з калекцыямі старажытных рарытэтаў, і пад іх уражаннем напісаў верш «Слуцкія ткачыхі». Далей у гэтым жа годзе ён спрабуе паступіць на філалагічны факультэт Пецярбургскага універсітэта, але з-за недахопу сродкаў і сырога клімату сталіцы, вяртаецца ў Яраслаўль, паступіўшы ў Дзямідаўскі юрыдычны ліцэй.\"},{\"date\":\"1914\",\"description\":\"у друкарні Марціна Кухты пры грашовай падтрымцы Марыі Магдалены Радзівіл накладам 2000 асобнікаў выдадзены адзіны прыжыццёвы зборнік твораў Максіма Багдановіча «Вянок». Зборнік утрымліваў 92 вершы і 2 поэмки, размешчаныя на 120 старонках.\"},{\"date\":\"1914—1916\",\"description\":\"Паэт піша цыкл вершаў «На ціхім Дунаі», паэму «Максім і Магдалена», іншыя творы. Пісаў Максім Багдановіч вершы і на рускай мове, напрыклад, «Навошта грустна яна была», «Я ўспамінаю Вас такой прыгожай, стройнай», «Зялёная каханне», «З восені». Да гэтага часу адносяцца і пераклады на беларускую твораў А. Пушкіна і Э. Верхарна.\"},{\"date\":\"лета 1916\",\"description\":\"Максім Багдановіч скончыўшы ліцэй вяртаецца ў Мінск. Хоць ён быў ужо цяжка хворы, але шмат працаваў у Мінскай губернскім харчовым камітэце і ў Беларускім камітэце дапамогі ахвярам вайны, а вольны час аддаваў літаратурнай творчасці.\"},{\"date\":\"люты 1917\",\"description\":\"Сябры паэта сабралі грошы, каб ён мог ехаць у Крым лячыцца ад сухотаў.\"},{\"date\":\"25 траўня 1917\",\"description\":\"Памёр Максім Багдановіч на досвітку ва ўзросце 25 гадоў.\"}],\"works\":[{\"date\":\"1907\",\"title\":\"Музы́ка\"},{\"date\":\"1910\",\"title\":\"Рушым, браты, хутчэй!\"},{\"date\":\"1911\",\"title\":\"Слуцкія ткачыхі\"},{\"date\":\"1912\",\"title\":\"Пан і мужык\"},{\"date\":\"1914\",\"title\":\"Санет\"}],\"gallery\":[\"./data/img/Bogdanovich1.jpg\",\"../data/img/Bogdanovich2.jpg\",\"./data/img/Bogdanovich3.jpg\"],\"video\":\"https://www.youtube.com/watch?v=xIHoUa6VJI8\",\"maps\":\"<iframe src='https://yandex.ru/map-widget/v1/?um=constructor%3Aca0787145253f3a3b70dcdfab8a861be037dc6d387c377b30882bd86d3d807b5&amp;source=constructor' width='100%' height='400' frameborder='0'></iframe>\"},{\"id\":\"1\",\"name\":\"Янка Купала\",\"birthplace\":\"Вязынка\",\"photo\":\"./data/img/Kupala1.jpg\",\"biography\":[{\"date\":\"7 ліпеня 1882\",\"description\":\"У вёсцы Вязынка (цяпер Маладзечанскага раёна Мінскай вобласці Беларусі) у беларускай каталіцкай сям'і Дамініка Ануфрыевіча Луцэвіча і Бянігны Іванаўны Луцэвіч.\"},{\"date\":\"1898\",\"description\":\"Скончыў народнае вучылішча ў мястэчку Бяларучы.\"},{\"date\":\"1902\",\"description\":\"Пасля смерці бацькі працаваў хатнім настаўнікам, пісарам у абшарніцкім маёнтку, прыказчыкам і на іншых працах.\"},{\"date\":\"1908-1909\",\"description\":\"жыў у Вільні, дзе працаваў у рэдакцыі першай беларускай газеты «Наша Ніва». Там жа пазнаёміўся з будучай жонкай - Уладзіславай Станкевіч\"},{\"date\":\"1909—1913\",\"description\":\"Пачатковец паэт вучыўся ў Санкт-Пецярбургу на падрыхтоўчых агульнаадукацыйных курсах А.Черняева.\"},{\"date\":\"7 красавіка 1914\",\"description\":\"Купала стаў рэдактарам газеты.\"},{\"date\":\"1915\",\"description\":\"Правучыўся ў Маскоўскім гарадскім народным універсітэце Янка Купала паступіў у народны ўніверсітэт у верасні, аднак яго намерам працягнуць вучобу перашкодзіла ўсеагульная мабілізацыя, аб'яўленая ў сувязі з надыходам Першай сусветнай вайны.\"},{\"date\":\"1916\",\"description\":\"Паэта-студэнта прызвалі ў армію і той паступіў у дарожна-будаўнічы атрад, у складзе якога працаваў аж да наступлення падзей Кастрычніцкай рэвалюцыі. Пасля рэвалюцыі Янка Купала пасяліўся ў Мінску.\"},{\"date\":\"1920-х да пачатку 1930-х\",\"description\":\"Янка Купала быў вымушаны, без усялякага перабольшання, прайсці праз мноства пакут. Спярша было несправядлівае абвінавачванне ў нядобранадзейнасці, у СМІ пачаў метадычна траўля паэта.\"},{\"date\":\"28 чэрвеня 1942\",\"description\":\"Янка Купала, які спыніўся ў гасцініцы «Масква», нечакана загінуў.\"}],\"works\":[{\"date\":\"15 ліпеня 1904\",\"title\":\"Мая доля\"},{\"date\":\"1905\",\"title\":\"Мужык\"},{\"date\":\"1906\",\"title\":\"Зімою\"},{\"date\":\"1907\",\"title\":\"Нікому\"},{\"date\":\"1912\",\"title\":\"Пау́линка\"}],\"gallery\":[\"./data/img/Kupala1.jpg\",\"./data/img/Kupala2.jpg\",\"./data/img/Kupala2.jpg\"],\"video\":\"https://www.youtube.com/watch?v=9FZehV2qJTk\",\"maps\":\"<iframe src='https://yandex.ru/map-widget/v1/?um=constructor:5f4bae2c662db968ba6b673318a1eb9455e410ba5232771eb524c0880a7b17e3&amp' width='100%' height='400' frameborder='0'></iframe>\"},{\"id\":\"2\",\"name\":\"Якуб Колас\",\"birthplace\":\"Акінчыцы\",\"photo\":\"./data/img/Kolas1.jpg\",\"biography\":[{\"date\":\"22 кастрычніка 1882\",\"description\":\"Нарадзіўся ў вёсцы Акінчыцы (цяпер тэрыторыя горада Стоўбцы Стаўбцоўскага раёна Мінскай вобласці Беларусі), у сям'і лесніка Міхаіла (Міхася) Міцкевіча.\"},{\"date\":\"1902\",\"description\":\"Скончыў Нясвіжскую настаўніцкую семінарыю.\"},{\"date\":\"1906\",\"description\":\"Першая публікацыя - верш «Край родны» у беларускай газеце «Наша доля».\"},{\"date\":\"1908\",\"description\":\"За ўдзел у арганізацыі нелегальнага настаўніцкага з'езда быў асуджаны да зняволення, якое адбываў у менскай турме да 1911 года.\"},{\"date\":\"1912\",\"description\":\"Настаўнічаў у Пінску да 1914 года, тут у яго нарадзіўся яго старэйшы сын Данііл.\"},{\"date\":\"1915\",\"description\":\"Эвакуіраваўся разам з сям'ёй у Падмаскоўі, працаваў настаўнікам у Дзмітраўскім павеце. У гэтым жа годзе мабілізаваны ў войска.\"},{\"date\":\"1918\",\"description\":\"Пасля дэмабілізацыі працаваў настаўнікам у горадзе Абаянь.\"},{\"date\":\"май 1921\",\"description\":\"Пераехаў у Мінск. У далейшым займаўся творчай і навуковай дзейнасцю.\"},{\"date\":\"1929\",\"description\":\"Прызначаны на пасаду віцэ-прэзідэнт Акадэміі навук БССР.\"},{\"date\":\"1938\",\"description\":\"Дэпутат ВС БССР (да 1956).\"},{\"date\":\"1944\",\"description\":\"Вярнуўся ў Менск.\"},{\"date\":\"1946\",\"description\":\"Абраны старшынёй Беларускага рэспубліканскага камітэта абароны міру.\"},{\"date\":\"13 жніўня 1956\",\"description\":\"Якуб Колас раптоўна памёр пасля продложительных хвароб. Пахаваны на Вайсковых могілках у Мінску.\"}],\"works\":[{\"date\":\"1908\",\"title\":\"зборнік вершаў «Песні няволі»\"},{\"date\":\"1910\",\"title\":\"зборнік вершаў «Песні смутку»\"},{\"date\":\"1912\",\"title\":\"зборнік прозы «Апавяданні»\"},{\"date\":\"1914\",\"title\":\"зборнік прозы «Родныя вобразы»\"},{\"date\":\"1923\",\"title\":\"паэма «Новая зямля»\"},{\"date\":\"1923\",\"title\":\"аповесць «У палескай глушы»\"},{\"date\":\"1925\",\"title\":\"паэма «Сымон-музыка»\"},{\"date\":\"1926\",\"title\":\"аповесць «На прасторах жыцця»\"},{\"date\":\"1928\",\"title\":\"аповесць «У глыбіні Палесся»\"},{\"date\":\"1930\",\"title\":\"цыкл вершаў «Калгаснае»\"},{\"date\":\"1931\",\"title\":\"аповесць «Адшчапенец»\"},{\"date\":\"1933\",\"title\":\"аповесць «Дрыгва»\"},{\"date\":\"1935\",\"title\":\"цыкл вершаў «Восеньскае»\"},{\"date\":\"1942\",\"title\":\"зборнік вершаў «Адпомсцім»\"},{\"date\":\"1943\",\"title\":\"зборнік вершаў «Голас зямлі»\"},{\"date\":\"1943\",\"title\":\"паэма «Суд у лесе»\"},{\"date\":\"1945\",\"title\":\"паэма «Адплата»\"},{\"date\":\"1947\",\"title\":\"паэма «Рыбакова хата»\"},{\"date\":\"1954\",\"title\":\"паэма «На ростанях»\"}],\"gallery\":[\"./data/img/Kolas1.jpg\",\"./data/img/Kolas2.jpg\",\"./data/img/Kolas3.jpg\"],\"video\":\"https://youtu.be/EPfYYg5QPMg\",\"maps\":\"<iframe src='https://yandex.ru/map-widget/v1/?um=constructor:ca4a8299bc13632d6d37f3f9949a46187e792a687810058d5ddd456f3ed8cb6c&amp;source=constructor' width='100%' height='400' frameborder='0'></iframe>\"},{\"id\":\"3\",\"name\":\"Змітрок Бядуля (Самуіл Яфімавіч Плаўнік)\",\"birthplace\":\"Посадец\",\"photo\":\"./data/img/Byadulya1.jpg\",\"biography\":[{\"date\":\"23 rрасавікa 1886\",\"description\":\"Нарадзіўся ў вёсцы Пасадзец Віленскай губерні Расійскай імперыі (цяпер Лагойскі раён, Мінская вобласць).\"},{\"date\":\"1910\",\"description\":\"Самуіл Плаўнік стаў пастаянным аўтарам віленскай газеты «Наша Ніва». Друкаваўся пад псеўданімамі Саша Пл-іч, Ясакар.\"},{\"date\":\"1912\",\"description\":\"Жыў у Вільні працаваў разам з Янкам Купалам у рэдакцыі названай газеты «Наша Ніва».\"},{\"date\":\"снежня 1917\",\"description\":\"Удзельнічаў у Першым Усебеларускім з'ездзе.\"},{\"date\":\"1918\",\"description\":\"Супрацоўнічаў з газетай «Беларускі шлях», якая выходзіла пад нямецкай акупацыяй.\"},{\"date\":\"1920\",\"description\":\"Некалькі гадоў працаваў у газеце «Савецкая Беларусь», рэдагаваў дзіцячы часопіс «Зоркі». Працаваў у Інстытуце беларускай культуры, быў першым рэдактарам краязнаўчага-этнаграфічнага часопіса «Наш край». Уваходзіў у літаратурнае аб'яднанне «Маладняк», затым у «Узвышша».\"},{\"date\":\"1934\",\"description\":\"Стаў членам Саюза пісьменнікаў СССР.\"},{\"date\":\"жнівень 1936\",\"description\":\"Разам з шэрагам іншых беларускіх літаратараў ад імя Саюза савецкіх пісьменнікаў БССР падпісаў ліст да Сталіна з заклікам знішчыць «мярзотнікаў з контррэвалюцыйнай трацкісцка-зиновьевской банды».\"},{\"date\":\"1941\",\"description\":\"Пісьменнік быў вымушаны пакінуць Беларусь. У эвакуацыі жыў спачатку ў піжмы Горкаўскай вобласці, затым, да канца кастрычніка 1941 г., у пасёлку Новыя Бурасы Саратаўскай вобласці.\"},{\"date\":\"3 лістапада 1941\",\"description\":\"Памёр каля Уральска ў Казахстане, дзе і быў пахаваны.\"}],\"works\":[{\"date\":\"1922\",\"title\":\"вершы «Палескія байкі» і паэма «Ярыла»\"},{\"date\":\"1927\",\"title\":\"аповесць «Салавей»\"},{\"date\":\"1931\",\"title\":\"зборнік апавяданняў «Незвычайныя гісторыі»\"},{\"date\":\"1932\",\"title\":\"раман «Язэп Крушынскі»\"},{\"date\":\"1939\",\"title\":\"аўтабіяграфічная аповесць «У дрымучых лясах»\"}],\"gallery\":[\"./data/img/Byadulya1.jpg\",\"./data/img/Byadulya2.jpg\",\"./data/img/Byadulya3.jpg\"],\"video\":\"https://youtu.be/GB_rlueYscM\",\"maps\":\"<iframe src='https://yandex.ru/map-widget/v1/?um=constructor%3A839bacaaac1112d29473f3ce826b08fe23d0a257636be26a6c6dd82806bde98e&amp;source=constructor' width='100%' height='400' frameborder='0'></iframe>\"},{\"id\":\"4\",\"name\":\"Максім Танк (Яўген Іванавіч Скурко)\",\"birthplace\":\"Пількаўшчына\",\"photo\":\"./data/img/Tank1.jpg\",\"biography\":[{\"date\":\"4 верасня  1912 года\",\"description\":\"Родился в селе Пильковщина (ныне Мядельского района Минской области Беларуси) в крестьянской семье.\"},{\"date\":\"1932\",\"description\":\"Нарадзіўся ў сяле Пильковщина (цяпер Мядзельскага раёна Мінскай вобласці Беларусі) у сялянскай сям'і.\"},{\"date\":\"1934\",\"description\":\"Арыштоўваўся польскімі ўладамі за актыўны ўдзел у палітычным жыцці Заходняй Беларусі.\"},{\"date\":\"1940\",\"description\":\"прыняты ў СП СССР.\"},{\"date\":\"1945\",\"description\":\"Максім Танк з'яўляўся рэдактарам у гумарыстычным часопісе «Вожык».\"},{\"date\":\"1948\",\"description\":\"галоўны рэдактар беларускага літаратурнага часопіса «Полымя».\"},{\"date\":\"1965\",\"description\":\"Старшыня ВС БССР да 1971 года\"},{\"date\":\"1969\",\"description\":\"Дэпутат Вярхоўнага Савета СССР.\"},{\"date\":\"1972\",\"description\":\"Акадэмік АН Беларускай ССР.\"},{\"date\":\"7 жнівень 1995\",\"description\":\"Максім Танк памёр у Мінску. Пахаваны ў роднай вёсцы.\"}],\"works\":[{\"date\":\"1936\",\"title\":\"паэтычны зборнік «На этапах»\"},{\"date\":\"1937\",\"title\":\"паэтычны зборнік «Журавінавы цвет»\"},{\"date\":\"1937\",\"title\":\"паэма «Нарач»\"},{\"date\":\"1938\",\"title\":\"«Пад мачтай»\"},{\"date\":\"1957\",\"title\":\"«След маланкі»\"},{\"date\":\"1964\",\"title\":\"«Глыток вады»\"},{\"date\":\"1972\",\"title\":\"«Хай будзе святло»\"}],\"gallery\":[\"./data/img/Tank1.jpg\",\"./data/img/Tank2.jpg\",\"./data/img/Tank3.jpg\"],\"video\":\"https://youtu.be/ZECpiojVfZs\",\"maps\":\"<iframe src='https://yandex.ru/map-widget/v1/?um=constructor%3A1b0fde151198d261e6a60ba762d46a7417343a098b9661a814068df248b81d8f&amp;source=constructor' width='100%' height='400' frameborder='0'></iframe>\"}];//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,eyJ2ZXJzaW9uIjozLCJmaWxlIjoiLi9zcmMvZGF0YS9wb2V0cy1ieS5qc29uLmpzIiwic291cmNlcyI6W10sIm1hcHBpbmdzIjoiIiwic291cmNlUm9vdCI6IiJ9\n//# sourceURL=webpack-internal:///./src/data/poets-by.json\n");

